import React from "react";
import styles from "./Landing.modules.css"
import { useHistory } from "react-router-dom"



function Landing() {
    let history = useHistory()

    return (

        <button id={styles.Butonplay} onClick={() => { 
            console.log("click")
            history.push('/home') }}>Play</button>

    )
}


export default Landing;
